import React from 'react';
import { useDispatch } from 'react-redux';
import { logout } from '../store/actions/authActions';
import { Link } from 'react-router-dom';
import { useSelector } from 'react-redux';
import { Button, Container, Navbar } from 'react-bootstrap';
import { LinkContainer, Row, Column } from "react-router-bootstrap";


const Dashboard = () => {
    const dispatch = useDispatch();

    const signout = () => {
        dispatch(logout())
    }

    const { user } = useSelector((state) => state.auth);


    return (
        <div>
            <Navbar bg="dark" variant="dark">
                <Container>
                    <LinkContainer to="/">
                        <Navbar.Brand >University Of Newcastle - Program Advisory Tool</Navbar.Brand>
                    </LinkContainer>
                    <Navbar.Text>
                        Signed in as: <a>{user.firstName} {user.lastName}</a>
                    </Navbar.Text>
                    <Button onClick={signout}>Logout</Button>
                </Container>
            </Navbar>

            <Container>
                <h2 className="bigHeader"> Dashboard </h2>
            </Container>

            <div>
                <p>Welcome {user.firstName} to our website again!</p>
                <p>Your email is: {user.email}</p>
            </div>

        </div>


    )
}

export default Dashboard;
